import React, { Component } from 'react'
import Info from './Info'
import Header from './Header'
import Hoss from './Hoss'
import Home from './Home'
import Face from './Face'
import { Switch, Route, Redirect } from 'react-router-dom';
import { MDBBtn, MDBCollapse, MDBCard,MDBCardTitle, MDBCardText,MDBCardBody} from 'mdbreact';

export class Main extends Component {
  constructor(props)  {
      super(props);
      this.state = {

          collapseID: ""

            };
            }
  toggleCollapse = collapseID => () => {
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ""
    }));
  }

render() {
     const HomePage = () =>{ 
      return(
<div>
    <MDBBtn
className="btn btn-dark btn-circle btn-xl"
onClick={this.toggleCollapse("basicCollapse")}><i class="fa fa-question"></i>
    </MDBBtn>
    <MDBCollapse id="basicCollapse" isOpen={this.state.collapseID}>
    <Home />
    </MDBCollapse>    </div>)
    }

  return (
    <div >
      <Home />
      <Switch>
      <Route path="/hoss" component={Hoss} />
      <Route  path="/info" component={Info} />
      <Route path= "/face" component={Face} />
      <Redirect to="/home" component={HomePage} />
      </Switch>
      <Hoss />
    </div>
  )
}
}

export default Main
